    public function encode($imagePath, $key): array
    {
        $image = Image::createFromPNG($imagePath);
        [$width, $height] = $image->getSize();
        $newImage = Image::create($width, $height);

        $keyIndex = 0;
        $c = 0;
        $keyLength = count($key);
        for ($y = 0; $y < $height; ++$y) {
            for ($x = 0; $x < $width; ++$x) {
                $rgb = $image->getRGBA($x, $y);
                $newColor = [];
                foreach (['red', 'green', 'blue'] as $color) {
                    $newColor[$color] = $rgb[$color] ^ $key[$keyIndex++];
                    if ($keyIndex === $keyLength) {
                        $key = $this->computeKey($key);
                        $keyIndex = 0;
                        ++$c;
                    }
                }
                $newImage->setPixel($x, $y, $image->createColor($newColor['red'], $newColor['green'], $newColor['blue']));
            }
        }
        $newImage->saveAs(__DIR__.'/output/encoded.png');

        return $key;
    }

    public function decode($imagePath, $key): void
    {
        $image = Image::createFromPNG($imagePath);
        [$width, $height] = $image->getSize();
        $newImage = Image::create($width, $height);

        $keyLength = count($key);
        $i = ($width * $height * 3) % $keyLength;
        $keyIndex = ($i % $keyLength);

        if (0 === $keyIndex) {
            $key = $this->reverseComputeKey($key);
            $keyIndex = $keyLength - 1;
        }

        for ($y = $height - 1; $y >= 0; --$y) {
            for ($x = $width - 1; $x >= 0; --$x) {
                $rgb = $image->getRGBA($x, $y);
                $newColor = [];
                foreach (array_reverse(['red', 'green', 'blue']) as $color) {
                    $newColor[$color] = $rgb[$color] ^ $key[$keyIndex--];
                    if ($keyIndex < 0) {
                        $key = $this->reverseComputeKey($key);
                        $keyIndex = $keyLength - 1;
                    }
                }

                $newImage->setPixel($x, $y, $image->createColor($newColor['red'], $newColor['green'], $newColor['blue']));
            }
        }

        $newImage->saveAs(__DIR__.'/output/decoded.png');
    }

    private function computeKey(array $key): array
    {
        return array_map(fn (int $e) => (91 * $e + 10) % 256, $key);
    }

    private function reverseComputeKey(array $key): array
    {
        return array_map(fn (int $e) => (int) gmp_strval(gmp_mod(($e - 10) * 211, 256)), $key);
    }
